import './App.css';
import { BrowserRouter as Router, Route, Switch} from "react-router-dom";
import Home from "./Home";
import Customer from "./customerWindowGUI"

function App() {
  return (
    <div className="app">
      <Routers>
        <Route path="/" element={<Home />} />
        <Route path="/customer" element={<Customer />} />
      </Routers>
    </div>  
  );
}

export default App;
